import React from 'react';

class User extends React.Component {
  state = { showUser: false };

  handleShowUser = () => this.setState({ showUser: !this.state.showUser });

  render() {
    const {
      accessType,
      deleteUser,
      email,
      fullName,
      handleShowUser,
      UserList,
      showUser
    } = this.props;
    return (
      <div>
        <p onClick={handleShowUser}>
          {fullName} {UserList}
        </p>
        {showUser && (
          <div>
            <p>
              {email} - {accessType}
            </p>
            <button onClick={deleteUser}>Delete User</button>
          </div>
        )}
      </div>
    );
  }
}

export default User;
